import React from 'react';
import Header from './components/Header';
import Sidebar from './components/Sidebar';
import Map from './components/Map.js';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="main-content">
        <Sidebar />
        <Map />
      </div>
    </div>
  );
}

export default App;
